import React, { useEffect, useState } from "react";
import './Style.css';
import axios from "axios";

export default function DataFetching(){
    const[posts, setPosts] = useState(['']);

    
    useEffect(()=>{
       axios.get('http://jsonplaceholder.typicode.com/posts')
       .then(res=>{
           setPosts(res.data)
       })
        .catch(err=>{
            console.log(err)
        })
   },[])


   const post = posts.map(posts => ( <li key={posts.id}>{posts.id}{posts.title}</li>))


    return(
    <React.Fragment>
      
    <ul>
        {post}
    </ul>
        </React.Fragment>
    )
}
